import Head from 'next/head';

const Layout = () => {
    <div>
        <Head>
            <title>Imdb Project</title>
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/4.1.1/css/bootstrap.min.css" />
        </Head>
        {props.children}
    </div>
}

export default Layout;
